function Homepage(){
    return(
        <>
         <Container className='description'>
            <div className="homepage"></div>
            <header >
              <h1>Hi, <span style={{fontSize:'48px'}}>I AM RIPUDAMAN</span> </h1>              
            </header>
            <div className='skills'>
                <Chip
                variant="default"
                size="medium"
                icon={< CodeRoundedIcon/>}
                label="ReactJS"
                color="secondary"
                /> 

                <Chip
                variant="default"
                size="medium"
                icon={< CodeRoundedIcon/>}
                label="Python"
                color="primary"
                />  


            </div>

            </Container>
        </>




    )
}

export default Homepage
